import styles from "./ProjectSection.module.scss";
import GoogleBooksProj from "../../styles/GoogleBooksProj.png";
import ecommerce_main from "../../styles/ecommerce_main.png";


export const ProjectSection = () => {
  return (
    <div className={styles.projects}>
      <h2 className={styles.projects__title}>
        â˜ž Thing's I've built and worked on
      </h2>
      <div className={styles.projects__list}>
        <div className={styles.projects__list_item}>
        <img
          src={ecommerce_main}
          height="400px"
          className={styles.projects__img}
        ></img>
        <div className={styles.projects__list_desc}>
          <h6 className={styles.desc__header}>Featured Project</h6>
          <h3 className={styles.desc__title}>Ecommerce App</h3>
          <p className={styles.desc__detail}>My version of book search engine that uses the Google Books API</p>
          <h6 className={styles.desc__header}>React | SaSS | Javascript | Firebase</h6>
        </div>
        <div className={styles.projects__list_item}>
        <img
          src={GoogleBooksProj}
          height="400px"
          className={styles.projects__list_img}
        ></img>
        <div className={styles.projects__list_desc}>
          <h6 className={styles.desc__header}>Featured Project</h6>
          <h3 className={styles.desc__title}>Google Books</h3>
          <p className={styles.desc__detail}>My version of book search engine that uses the Google Books API</p>
          <h6 className={styles.desc__header}>HTML | SaSS | Javascript | DOM API</h6>
        </div>
        </div>
      </div>
    </div>
    </div>
  );
};
